マジカルカーボンを使用したエンブレム。<br><br>車種専用にデザインカットされていますので、<br>そのまま貼りつけるだけで 簡単にイメージチェンジが出来ます。 <br><br>■マジカルカーボンとは？<br>本物のカーボン繊維を使用し、特許技術製法により<br>緩やかな曲面・段差にも貼り付け可能にした商品です。<br>ドレスアップに加え、ボディの保護にも抜群の効果を発揮いたします。<br><br>■注意<br>商品画像は、イメージ写真です。<br>商品には、カーボンのみでエンブレムは付属しません。<br><br>マゼラン(マジョーラカラー)は見る角度により見え方が変わる<br>特殊塗料を使用したカーボンです。<br>画像は色の変化をイメージした合成写真の為、実際の商品の<br>見え方とは事なりますので予めご了承下さい。<br><br>■適合車種<br>・フリードGB3・4 年式：2008.5～<br>・フリードスパイクGB3・4 年式：2010.7～<br>・シビック EU3・4 年式：2003.9～2005.9<br><style type="text/css">
