・マジカルカーボンシリーズは炭素繊維素材、及びガラス繊維素材を特殊技術により柔軟性をもたせ特殊印刷で仕上げた高級なシートです。<br>・車種別にカットしてある為、誰でも簡単に貼るだけでドレスアップすることが可能です！<br>・素材の輝きと光沢を放ちつつ、カーボンの立体感・質感が味わえ、高級感を醸し出しながらエレガンスに仕上がります。 もちろん、シート自体に弾力性があるため、保護力も十分です。 <br><br>【対応】<br>・ホンダ <br>フィット GD1～4 2001.6～2007.9<br>インサイト ZE2 2009.2～<br>エアウェイブ GJ1・2 2005.4～<br>モビリオスパイク GK1・2 MC後 2005.12～2008.6<br>N-ONE JG1/JG2 2012.11～<br>モビリオ LA-GB1・2 （MC前） フロント用 2001.12～2004.11<br>N-ワゴン・カスタム JH1・2 2013.11～<br>オデッセイアブソルート RC1・2系 2013.11～<br>・リヤエンブレム用 （※モビリオはフロント用）<br><br>・リヤエンブレム用 ●カラー：ブラック<br>●内容物：カーボンシート<br><br>※注意<br>・本製品は車種別専用タイプです。車種適合をお間違えないようお願いします。<br>・商品にエンブレムは含まれません。<style type="text/css">
